import React, { component } from 'react';
import Cardlist from './Cardlist';
import SearchBox from './SearchBox';
import { robots } from './robots';
import { Component } from 'react';

class App extends component {
    constructor () {
      super ();
      this.state = {
        robots : robots,
        searchinput : ""
      }
    }
    render () {
        return (
            <div className="tc">
              <h1>RoboFriends</h1>
              <SearchBox />
              <Cardlist robots = { robots }/>  
            </div>
          );
    }
}

export default App;
